import React, { Component } from "react";

import {
  Col,
  Row,
  Button,
  Form,
  Card,
  FormGroup,
  Jumbotron,
  Container,
  Label,
  Input,
  FormText,
  InputGroup,
} from "reactstrap";
import InputRange from "react-input-range";
import "react-input-range/lib/css/index.css";
class FilterPage extends Component {
  render() {
    return (
      <>
        <div>
          <Jumbotron>
            <Container tag="h1" style={{ height: 0, marginTop: -30 ,backgroundColor:"#fb6340"}}>

                FIND YOUR PLAYER

            </Container>
          </Jumbotron>
        </div>
        <div style={{ marginTop: -60 }}>
          <Card className="bg-secondary shadow border-3">
            <Form style={{ marginLeft: 10, marginRight: 100, marginTop: 40 }}>
              <Row
                style={{
                  textAlign: "center",
                  paddingLeft: 340,
                  paddingRight: 340,
                }}
              >
                <Col>
                  <Label for="exampleEmail">Name</Label>
                  <Input
                    style={{ borderColor: "#fb6340" }}
                    type="email"
                    name="email"
                    id="exampleEmail"
                    placeholder=""
                  />
                </Col>
              </Row>
              <Row style={{ marginTop: 20 }}>
                <Col>
                  <Label for="exampleSelect">Position</Label>
                  <InputGroup style={{ marginTop: 10 }}>
                    <Input
                      style={{ borderColor: "#fb6340" }}
                      type="select"
                      name="select"
                      id="exampleSelect"
                    >
                      <option>KL</option>
                      <option>2</option>
                      <option>3</option>
                      <option>4</option>
                      <option>5</option>
                    </Input>
                  </InputGroup>
                </Col>
                <Col>
                  <Label for="exampleSelect">Nationality</Label>
                  <InputGroup style={{ marginTop: 10 }}>
                    <Input
                      type="select"
                      name="select"
                      id="exampleSelect"
                      style={{ borderColor: "#fb6340" }}
                    >
                      <option>Afghanistan</option>
                      <option>2</option>
                      <option>3</option>
                      <option>4</option>
                      <option>5</option>
                    </Input>
                  </InputGroup>
                </Col>
                <Col>
                  <Label for="exampleSelect">League</Label>
                  <InputGroup style={{ marginTop: 10 }}>
                    <Input
                      type="select"
                      name="select"
                      id="exampleSelect"
                      style={{ borderColor: "#fb6340" }}
                    >
                      <option>Bundesliga</option>
                      <option>2</option>
                      <option>3</option>
                      <option>4</option>
                      <option>5</option>
                    </Input>
                  </InputGroup>
                </Col>
                <Col>
                  <Label for="exampleSelect">Team</Label>
                  <InputGroup style={{ marginTop: 10 }}>
                    <Input
                      type="select"
                      name="select"
                      id="exampleSelect"
                      style={{ borderColor: "#fb6340" }}
                    >
                      <option>Liverpool</option>
                      <option>2</option>
                      <option>3</option>
                      <option>4</option>
                      <option>5</option>
                    </Input>
                  </InputGroup>
                </Col>
